import React, { useEffect, useState } from "react";
import productService from "../services/productService";
import "./ProductManagement.css";

function ProductManagement() {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [editingProduct, setEditingProduct] = useState(null);
  const [newPrice, setNewPrice] = useState("");
  const [newStock, setNewStock] = useState("");

  // Fetch all products
  useEffect(() => {
    async function fetchProducts() {
      try {
        const data = await productService.getAllProducts();
        console.log("Fetched products:", data); // Log the response
        setProducts(Array.isArray(data) ? data : data.products || []); // Ensure it's an array
      } catch (err) {
        console.error("Error fetching products:", err);
        setError(err.message || "Failed to fetch products.");
      } finally {
        setLoading(false);
      }
    }
    fetchProducts();
  }, []);

  // Handle update button click
  const handleUpdateClick = (product) => {
    setEditingProduct(product);
    setNewPrice(product.productPrice); // Set current price as default
    setNewStock(product.productStorage); // Set current stock as default
  };

  // Confirm updates
  const handleConfirmUpdate = async () => {
    if (editingProduct) {
      try {
        // Update price and stock
        await productService.updatePrice(editingProduct.productID, parseFloat(newPrice));
        await productService.updateStorage(editingProduct.productID, parseInt(newStock));

        // Refresh product list
        const updatedProducts = await productService.getAllProducts();
        setProducts(updatedProducts);

        // Reset editing state
        setEditingProduct(null);
        setNewPrice("");
        setNewStock("");
      } catch (err) {
        console.error("Error updating product:", err);
        setError(err.message || "Failed to update product.");
      }
    }
  };

  if (loading) return <p>Loading products...</p>;
  if (error) return <p className="error-message">{error}</p>;

  return (
    <div className="product-management-container">
      <h1>Product Management</h1>
      <table>
        <thead>
          <tr>
            <th>Product ID</th>
            <th>Name</th>
            <th>Price</th>
            <th>Stock</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {products.map((product) => (
            <tr key={product.productID}>
              <td>{product.productID}</td>
              <td>{product.productName}</td>
              <td>${product.productPrice.toFixed(2)}</td>
              <td>{product.productStorage}</td>
              <td>
                <button onClick={() => handleUpdateClick(product)}>Update</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      {editingProduct && (
        <div className="update-form">
          <h2>Update Product: {editingProduct.productName}</h2>
          <label>
            Price:
            <input
              type="number"
              value={newPrice}
              onChange={(e) => setNewPrice(e.target.value)}
              step="0.01"
            />
          </label>
          <label>
            Stock:
            <input
              type="number"
              value={newStock}
              onChange={(e) => setNewStock(e.target.value)}
            />
          </label>
          <button onClick={handleConfirmUpdate}>Confirm Update</button>
          <button onClick={() => setEditingProduct(null)}>Cancel</button>
        </div>
      )}
    </div>
  );
}

export default ProductManagement;
